import React, { Component } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";
import authenicate from "../Utils/authenicate";
import "./css/NavigationBar.css";
import store from "../Redux/store";

class NavigationBar extends Component {
  constructor(props) {
    super(props);

    this.toggleNavbar = this.toggleNavbar.bind(this);
    this.state = {
      collapsed: false,
      loggedIn: Boolean
    };
  }

  // life cycle
  componentDidMount() {
    console.log(store.getState());
    this.setState({ loggedIn: store.getState().isLoggedIn });
  }

  // methods
  toggleNavbar() {
    this.setState({
      collapsed: !this.state.collapsed
    });
  }

  // render
  render() {
    return (
      <div className="navContainer">
        <Navbar color="dark" dark>
          <NavbarBrand href="/" className="mr-auto">
            Price Expense Tracker
          </NavbarBrand>
          <NavbarToggler onClick={this.toggleNavbar} className="mr-2" />
          <Collapse isOpen={!this.state.collapsed} navbar>
            <Nav navbar>
              <NavItem>
                <NavLink href="/categories">Categories</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/expenses">Expenses</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/users">Users</NavLink>
              </NavItem>
              {this.state.isLoggedIn ? (
                <NavItem>
                  <NavLink href="/logout" onClick={authenicate.removeToken}>
                    Logout
                  </NavLink>
                </NavItem>
              ) : (
                <NavItem>
                  <NavLink href="/login">Login/Register</NavLink>
                </NavItem>
              )}
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}

export default NavigationBar;
